import React from 'react';

class TempUnitButton extends React.Component {
  render() {
    return (
      <div className="tempButton">
        <button type="button" name="celcius" autoFocus>&#8451;</button>
        <button type="button" name="farenheit" disabled>&#8457;</button>
      </div>
    );
  }
}

export default TempUnitButton;
